export default function Header(props) {
    return (
        <header>
            
                <div className="nav-wrapper container">
                    <a href="#" className="brand-logo"></a>
                    <ul id="nav-mobile" className="right hide-on-med-and-down">
                        <li><a href="#">Link one</a></li>
                        <li><a href="#">Link two</a></li>
                    </ul>
                </div>

        </header>
    );
}
